var EdaEventDirectAjax = Class.create();
EdaEventDirectAjax.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    send: function() {
		var http = new EdaEventDirect();
		return http.send(this.getParameter('url'), this.getParameter('token'), this.getParameter('body'));
	},

    type: 'EdaEventDirectAjax'
});
